// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract PatientContract {
    struct Patient {
        string patientName;
        string patientNid;
        address patientAddress;
    }

    mapping(string => Patient) public patients; // NID => Patient

    function registerPatient(
        string memory _nid,
        string memory _patientName,
        address _patientAddress
    ) public {
        require(bytes(patients[_nid].patientName).length == 0, "Patient already registered");

        patients[_nid] = Patient({
            patientName: _patientName,
            patientNid: _nid,
            patientAddress: _patientAddress
        });
    }

    function getPatient(string memory _nid) public view returns (Patient memory) {
        require(bytes(patients[_nid].patientName).length > 0, "Patient not found");
        return patients[_nid];
    }
}
